def S(n) :
	if n == 1:
		return 1
	if n == 2:
		return 2
	if n == 3:
		return 5
	k = n / 2
	if n % 2 == 0 :
		return S(k - 1) + 1
	else :
		return S(k + 1)

## Calculate difference between consecutive elements
def T(n) :
	if n == 1:
		return 0
	if n == 2:
		return 1
	if n == 3:
		return 1
	k = n / 2
	if n % 2 == 0 :
		return S(k - 1) + S(k) + k - 1
	else :
		return -S(k) + 1 - k

## Calculate nth term of sequence
def R(n) :
	if n &lt;= 1 :
		return 1
	elif n == 2:
		return 2
	k = n / 2
	if n % 2 == 0 :
		return int(2 * (R(k) + T(k + 1) / 2.0) + k)
	else :
		return int(2 * (R(k - 1) + T(k) / 2.0) + 1)

