public class Answer {   
    public static int answer(int food, int[][] grid) { 
        int val = helper(food, grid, grid[0].length - 1, grid.length - 1);
        return val;
    } 
    public static int helper(int food, int[][] grid, int x, int y) {
        if (food &lt; 0){
            return -1;
        }
        if (x == 0){
            for(int i = 1; i &lt;= y; i++){
                food -= grid[0][i];
            }
            return Math.max(food, -1);
        }
        if (y == 0){
            for(int i = 1; i &lt;= x; i++){
                food -= grid[i][0];
            }
            return Math.max(food, -1);
        }

        int right = helper(food - grid[x][y], grid, x - 1, y);
        int left = helper(food - grid[x][y], grid, x, y - 1);
        if (right &lt; 0){
            return left;
        } else {
            if (left &lt; 0){
                return right;
            }
            return Math.min(right, left);
        }
    }
